import fav from "../../Images/heart.png";
export default function ProductCards(props){
    return(
            <div className="aem-Grid aem-Grid--12">
              <section className="prod-items aem-GridColumn aem-GridColumn--default--3">
                Clothing / Women's / Outerwear
              </section>
              {props.data.map((product) => {
                return (
                  <section key={product.id} className="prod-items aem-GridColumn aem-GridColumn--default--3 aem-GridColumn--tablet--6 aem-GridColumn--phone--12">
                    <img className="prod-image" src={product.image} alt={product.title}/>
                    <h3 className="prod-title">{product.title}</h3>
                    <span className="prod-price">${product.price}</span>
                    <img classname="fav-prod" src={fav} alt="add favorite"/>
                  </section>
                );
              })}
            </div>
          );
}
